sys_variable_value.value:
(function execute(inputs, outputs) {

  var response = JSON.parse(inputs.response)

  var fail = false

  if (!response) {
    fail = true
  }


  if (response.status) {
    outputs.status = response.status
  } else {
    fail = true
  }

  outputs.fail = fail

})(inputs, outputs);

